import React from 'react';
import "./Event.css"
export default function Event({ id, name, description, startTime, endTime }) {
  return (
    <div className="event">
      <h2>{name}</h2>
      <p>ID: {id}</p>
      <p>Description: {description}</p>
      <p>Start Time: {startTime}</p>
      <p>End Time: {endTime}</p>
    </div>
  );
}
